import Layout from '../components/MyLayout';

export default function Events() {
  const aboutStyle = {
    textAlign: 'center',
    width: '50%',
    marginLeft: 'auto',
    marginRight: 'auto',
    lineHeight: '50px',
    fontFamily: '"Arial Black", Gadget, sans-serif'

  }
  return (
    <Layout>
      <iframe src="https://calendar.google.com/calendar/embed?src=3082j1ajugf6ndi9t4drar92fc%40group.calendar.google.com&ctz=America%2FLos_Angeles" style={{border: 0, width:"1000px", height:"1000px",frameborder:"0",scrolling:"no"}}></iframe>
    </Layout>
  );
}
